import React from 'react';

function Todo({ todo }) {
    function checkboxClicked() {
        itsComplete(todo.id); 
    }

    return (
        <div style={{ display: 'flex'}}>
            <input type='checkbox'/>
            <li style={{
                color: 'white',
                textDecoration: todo.comleted ? 'line-through' : null
            }}
            >{todo.task}</li>
            <button>X</button>
        </div>

    );
}


export default Todo;
